  return (
    <>
    <Grid>
      <Grid.Col span={10}>
        <BreadcrumbsComponent/>
      </Grid.Col>
      <Grid.Col span={2}>
        <Input component="select" rightSection={<ChevronRight />}>
          <option value="All">All</option>
          <option value="Most Popular">Most Popular</option>
          <option value="New Arrivals">New Arrivals</option>
          <option value="Up Coming">Up Coming</option>
          <option value="Price high to low">Price high to low</option>
          <option value="Price low to high">Price low to high</option>
        </Input>
      </Grid.Col>
    </Grid>
    <Space h="md" />
    <Grid>
        {
          Object.keys(mobiles).slice(0,12).map(key=>{
          // Object.keys(mobiles).map(key=>{
            let desc = mobiles[key]['href'].split('_')
            let brand = desc[0].substring(1)
            let title = desc[1].split('-').join(' ')
  
            return (
              <Grid.Col md={6} lg={3} key={mobiles[key]['href']}>
                    <CardWithStats
                    image="https://i.hood.de/fit-in/3000x3000/filters:no_upscale()/images/50144/501441090.jpg"
                    title={title}
                    description={ brand+" • 2022 • Flagship" }
                    stats={
                      [
                        { "title": "Price", "value": mobiles[key]['price']},
                        { "title": "Avg. rating", "value": "4.75" }
                      ]
                    }
                    ></CardWithStats>
              </Grid.Col>
            )

        })
      }
      </Grid>
      </>
  );
